import React, { useState } from 'react';
import 'Datafetch.css'
import axios from 'axios';

function Datafetch() {
  const [fromDate, setFromDate] = useState('');
  const [toDate, setToDate] = useState('');
  const [scripts, setScripts] = useState('');
  const [timeframe, setTimeframe] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Send form data to Django endpoint
      const response = await axios.post('http://localhost:8000/fetchdata/fetchdata/', {
        from_date: fromDate,
        to_date: toDate,
        scripts,
        timeframe,
      });
      console.log('Response from Django:', response.data);
    } catch (error) {
      console.error('Error sending request:', error);
    }
  };


  return (
    <>
      <div className='analysis_page'>
        <div className='query_container'>


          <form className='queryform' onSubmit={handleSubmit}>
            <div>
              <label htmlFor="fromDate">From Date:</label>
              <input
                type="date"
                id="fromDate"
                value={fromDate}
                onChange={(e) => setFromDate(e.target.value)}
                required
              />
            </div>
            <div>
              <label htmlFor="toDate">To Date:</label>
              <input
                type="date"
                id="toDate"
                value={toDate}
                onChange={(e) => setToDate(e.target.value)}
                required
              />
            </div>
            <div>
              <label htmlFor="scripts">Scripts:</label>
              <input
                type="text"
                id="scripts"
                value={scripts}
                onChange={(e) => setScripts(e.target.value)}
                required
              />
            </div>
            <div>
              <label htmlFor="timeframe">Timeframe:</label>
              <select
                id="timeframe"
                value={timeframe}
                onChange={(e) => setTimeframe(e.target.value)}
                required
              >
                <option value="">Select timeframe</option>
                <option value="1D">1 Day</option>
                <option value="1W">1 Week</option>
                <option value="1M">1 Month</option>
                <option value="3M">3 Months</option>
                <option value="6M">6 Months</option>
                <option value="1Y">1 Year</option>
                <option value="YTD">Year to Date</option>
                <option value="ALL">All</option>
              </select>
            </div>
            <button type="submit">Submit</button>
          </form>

        </div>
      </div>
    </>);

}

export default Datafetch;
